Information
------------------------------

Remember high school? Renowned filmmaker Frederick Wiseman's classic documentary High School renders this nearly universal American experience in unforgettable terms. Cited by the Library of Congress as a National Treasure, this 1968 film is both a document of the times and a statement of the ways in which school is used by one generation to pass its values on to the next. 
High School, Wiseman's second film, depicts Northeast High School, located in Philadelphia. Through the observations of the filmmaker's camera, the result is an endlessly absorbing look at exchanges between teachers and students, and the desperate need for the older generation to uphold tradition by passing their morals onto students who are growing up in a very complex time.

